   render(){
       return (
        <div>
          <h3>ReduxPage</h3>
          <span>store.getState().counterReducer</span>
          <button >add</button>
          <button >minus</button>
        </div>
       )
   }
}
ReactDOM.render (
<div>
<h1>欢迎使用redux!</h1> 
<hr/>

